 wait for 1 second;
 //get the context menu
 call right-click();
 //get system tables
 status, status-text= call wait-for-and-click-on-text ("System Tables", 2);
 if status then begin
  call fail(node, "Error in player: [status-text]");
  return;
 end;
// go to misc parameters
 status, status-text= call wait-for-and-click-on-text 
   ("Miscellaneous Parameters", 2);
 if status then begin
  call fail(node, "Error in player: [status-text]");
  return;
 end; 
 wait for 2 seconds;
 //go to our parameter
 status-number = call g2-move-to-text("Write extended memory report?");
 if status-number /= 1 then begin
  call fail(node, "g2-move-to-text failed");
  return;
 end;
 call g2-move(250, 0);
 call double-click(); 
 call g2-move(250, 0); { moving to the right, and leave the table to main window }
 call click();
 wait for 2 seconds;
 status = call write-g2-stat-report(node);
 if not (status) then return;

//at this point we are sure that the report exists

 wait for 1 second;
 call pass(node);
end

